import React from 'react'


const Table = ({lista}) => (
  <table>
    {lista.map((row, i)=>(
      <tr>
        {console.log(row)}
        <td key={i}>{row.name}</td>
        <td key={i+1}>{row.data}</td>
      </tr>
    ))}
  </table>
)

export default Table
